import ExpenseItem from "./ExpenseItem";
function Expenses(props) {
  return props.forEach((item) => {
    <ExpenseItem
      title={props[item].title}
      amount={props[item].amount}
      date={props[item].date}
    />;
  });
}

export default Expenses;
